import { Component, HostListener } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})


export class HomeComponent {
  isFlipped = false;

  onMouseEnter() {
    this.isFlipped = true;
  }

  onMouseLeave() {
    this.isFlipped = false;
  }
}
